Água: regue quando o solo começar a ficar ligeiramente seco no topo. Não regue em excesso.

Temperatura: Prefere temperaturas quentes a altas, idealmente entre 18-24 ° C, mas pode lidar com temperaturas tão baixas quanto 10 ° C por curtos períodos. Evite rascunhos.

Umidade: Níveis de umidade normal a elevados funcionam melhor. Dieffenbachia irá saborear a nebulização ocasional e o uso de uma bandeja de seixos.

Alimentação: aplique uma dose fraca de fertilizante uma vez por mês durante a estação de crescimento.

Dicas de cuidados: Limpe as folhas com um pano úmido para remover a poeira acumulada ou coloque-o no chuveiro por um tempo. Corte removendo a parte superior da planta se ela crescer muito.

Purificação de ar: esta planta filtra toxinas transportadas pelo ar e faz parte de nossa coleção de plantas de ar limpo.

Altura e taxa de crescimento: altura final 1-1,2 m. Crescimento moderadamente rápido.

Toxicidade: as folhas e a seiva são tóxicas e não devem ser ingeridas. Mantenha longe de crianças e animais.

Origem: América Tropical. 🌱💚
Fonte: biohydrokw.com

