Nascido em 25 de janeiro de 1942, em Lourenço Marques, Maputo, atual capital de Moçambique, começou sua carreira no Sporting Lourenço Marques (1957), tendo 40 partidas disputadas na filial do Sporting, neste caso, em Moçambique. 

Após seu sucesso por lá, migrou-se para o Benfica em 1961, se consagrando já em sua primeira partida com um hat-trick frente ao Atlético. Com isso, se tornou essencial no clube, apresentando puro talento e uma figura assombrosa diante de qualquer adversário que enfrentasse. 

Começou a atuar pela seleção portuguesa em 1961, mesmo ano em que chegou ao Benfica, marcando pelo menos um gol em sua estreia contra o Luxemburgo, vitória de 4 a 2 para a seleção portuguesa. Já em 1962, um ano depois, aos 20 anos de idade, Eusébio marcou dois gols cruciais na final da Copa Europeia, ajudando o Benfica a virar o jogo contra o Real Madrid, selando o título para o clube português. 

Apesar disso, seu ápice na seleção teve como maior destaque, a sua interferência de excelência a partir de 1966, na Inglaterra, liderando os portugueses no Mundial, pois um ano antes, o Pantera Negra ficou na história por ser o primeiro jogador português a receber a Bola de Ouro, ação executada pela France Football. Fora que, ainda teve como premiação em 1968 e 1973, duas Botas de Ouro. 

Em sua carreira, ele venceu 11 campeonatos. A sua influência é bem demonstrativa, já que foi sete vezes o melhor marcador do campeonato português. Juntou-se também cinco taças de Portugal e a forte representatividade obtida enquanto esteve no Benfica. 

Chegou a atuar pelos demais clubes, acima abordados, com um valor simbólico, de imagem e de sucesso para o mundo do futebol, e consequentemente, do esporte.

